def war(N,K):
    """
    strategy: N plays lowest number first, K chooses next best number
    """
    if len(N) == 0: return 0
    n = N[0]
    if K[-1] > n:
        # ken wins
        k = len(K)-1
        for k in range(len(K)-1):
            if K[k] > n and K[k+1] > n:
